import React,{useState} from 'react';
import client from '../util/shopify-client'


client.product.fetchAll()


const ItemList = () => {
    return (
        <div>
            Hello
        </div>
    )
}



const Store = () => {
    return(
        <div style={{
            position:"relative",
            top:"20vh"
        }}>
            Hello
            <ItemList />
        </div>
    )
}

export default Store;
